window.bookSummaryJSON = "<p>Only a fool would venture into the freezing mists that steal the souls of men. And that’s exactly where Odin is going. </p> <p>When a frost giant murders his father, Odin swears blood vengeance. Guided by his blood-brother Loki, Odin battles rival tribes and perilous ghosts. His quest leads him to a chance at immortality...but the price will be more than he can imagine. </p> <p>Enter this grim fantasy retelling of Norse mythology today.</p>"; 
